import React, { Component } from "react";

class Like extends Component {
  state = {};
  handleLike = () => {};
  render() {
    return (
      <i
        onClick={this.handleLike}
        className='fa fa-heart-o'
        aria-hidden='true'
      ></i>
    );
  }
}

export default Like;
